import React from "react";
import { useState } from 'react';
import '../stylesheets/AddWine.css';

function AddWine () {
  const nameref = React.useRef();
  const wineryref = React.useRef();
  const descref = React.useRef();
  const [inputs, setInputs] = useState({});

  const handleChange = (event) => {
    console.log(event)
    console.log("handlechange: name",event.target.name);
    console.log("handlechange: value",event.target.value);
    const name = event.target.name;
    const value = event.target.value;
    setInputs(values => ({...values, [name]: value}))
  }

  const handleSubmit = (event) => {

    event.preventDefault();
    const name = nameref.current.value;
    const winery = wineryref.current.value;
    const desc = descref.current.value;

    console.log("name: ", name);
    console.log("winery: ", winery);
    console.log("desc: ", desc);
    // alert(inputs);
  }

  return (
    <div className="addWine">
      <h2>Add more Wine</h2>

      <form className="needs-validation " onSubmit={handleSubmit}>
        <div className="row d-flex justify-content-around">
          <div className="col-md-4 mb-3">
            <label forhtml="validationCustom01">Name</label>
            <input type="text" className="form-control" ref={nameref} id="validationCustom01" placeholder="Name" onChange={handleChange} required />
            <div className="valid-feedback">
              Looks good!
            </div>
          </div>
          <div className="col-md-4 mb-3">
            <label for="validationCustom02">Winery</label>
            <input type="text" className="form-control" ref={wineryref} d="validationCustom02" placeholder="Winery" onChange={handleChange} required />
            <div className="valid-feedback">
              Looks good!
            </div>
          </div>
        </div>
        <div className="row d-flex justify-content-around">
          <div className="col-md-4 mb-3">
            <label for="validationCustom03">Year</label>
            <input type="text" className="form-control" id="validationCustom03" placeholder="Year" onChange={handleChange}/>
          </div>
          <div className="col-md-4 mb-3">
            <label for="validationCustom04">Variety</label>
            <input type="text" className="form-control" id="validationCustom04" placeholder="Variety" onChange={handleChange}/>
          </div>
          <div className="col-md-4 mb-3">
            <label for="validationCustom04">Region</label>
            <input type="text" className="form-control" id="validationCustom04" placeholder="Region" onChange={handleChange}/>
          </div>

        </div>
        <div className="row">
          <div className="col-md-8 mb-3">
            <label for="validationCustom02">Description</label>
            <input type="text" className="form-control" id="validationCustom02" ref={descref} placeholder="Description" onChange={handleChange}/>
            <div className="valid-feedback">
              Looks good!
            </div>
          </div>
          <div className="col-md-4 mb-3 custom-file">
            <input type="file" className="custom-file-input" id="customFile"/>
            <label className="custom-file-label" for="customFile">Choose file</label>
          </div>
        </div>
        <button className="btn btn-primary" type="submit" onClick={handleSubmit}>Submit form</button>
      </form>
    </div>
  );
}

export default AddWine;





